import React from 'react'
import './Tabs.css'
const Tabcontent=(props)=>{
    return(
        <div className="Content">
                <div className="tab-content"style={{display:`{props.tab1Content}`}} >
                     tab 1 Content
                </div>
                <div className="tab-content">
                tab 2 Content
                    </div>
        </div>
    )
}
export default Tabcontent;
